class App extends Component {
  render() {
    return (
      <div>
        <nav 
          style={{
            borderBottom: "solid 1px",
            paddingBottom: "1rem"
          }}
          >
            <Link to="./pages/Home">Home</Link>
          </nav>
      </div>
    );
  }

}

export default App;
